import React from "react";
import styled from "styled-components";

const Lines = styled.div`
  width: 100%;
  height: 1px;
  background: black;
  border-radious : 50%;
`;

const Footer = () => {
  return (
    <div style={{background:"#eeeeee"}}>
      <Lines />
      <h1>I am footer</h1>
    </div>
  );
};

export default Footer;
